import React from "react";
import "./style.css";

function FriendCard(props) {
  return (
    <div className="card-group d-flex flex-wrap">
      <div className="img-container">
          <img className="image" alt={props.name} src={props.image} />
      </div>
    </div>
  );
}

export default FriendCard;
